import React from 'react'
import '../../assets/css/App.css';

const Home = () => {
  return (
    <div className="App-home">
      <main>
        <img alt="todolater"></img>
        <p>My name's d1nker - and I made a list of all tutorials</p>
        <p>I've been learning with React</p>
        <p>I hope you'll enjoy it as much as I did.</p>
      </main>
    </div>
  );
}

export default Home;
